import adapter from './adapter'

var streams = [];


class Streams{
	constructor(name){
		this.name = name;
	}

}


function fetchStreams(){
  	adapter.getStreams()
  	.then(streams => retireveStreams(streams))
  }

 function retireveStreams(list){

  	streams = list.map(stream=> {
    	return new Streams(stream.name);
  	});


  	console.log(streams);
  	return streams
  }


export default streams
